void IndexedDBControlAsyncWaiter::DownloadBucketData(
    ::storage::BucketId bucket_id, bool* out_success, ::base::FilePath* out_temp_path, ::base::FilePath* out_zip_path)
{
    base::RunLoop loop;
    proxy_->DownloadBucketData(std::move(bucket_id),
        base::BindOnce(
            [](base::RunLoop* loop, bool* out_success, ::base::FilePath* out_temp_path, ::base::FilePath* out_zip_path, bool success,
                const ::base::FilePath& temp_path, const ::base::FilePath& zip_path) {
                *out_success = std::move(success);
                *out_temp_path = std::move(temp_path);
                *out_zip_path = std::move(zip_path);
                loop->Quit();
            },
            &loop, out_success, out_temp_path, out_zip_path));
    loop.Run();
}

